// Import images
import chocolateLavaCake from './lava_cake.jpg';
import chocolateCake from './chocolate cake.jpg';
import iceCream from './ice cream.jpg';
import brownies from './brownies.jpg';
import cheesecake from './cheese cake.jpg';
import fruitSalad from './fruit salad.jpg';
import tiramisu from './tiramisu.jpg';
import cupcakes from './cupcakes.jpg';
import pudding from './pudding.jpg';
import applePie from './apple pie.jpg';
import donuts from './donuts.jpg';
import macarons from './macarons.jpg';

// Define the desserts array
const desserts = [
    { id: 1, name: "Chocolate Lava Cake", picture: chocolateLavaCake },
    { id: 2, name: "Chocolate Cake", picture: chocolateCake },
    { id: 3, name: "Ice Cream", picture: iceCream },
    { id: 4, name: "Brownies", picture: brownies },
    { id: 5, name: "Cheesecake", picture: cheesecake },
    { id: 6, name: "Fruit Salad", picture: fruitSalad },
    { id: 7, name: "Tiramisu", picture: tiramisu },
    { id: 8, name: "Cupcakes", picture: cupcakes },
    { id: 9, name: "Pudding", picture: pudding },
    { id: 10, name: "Apple Pie", picture: applePie },
    { id: 11, name: "Donuts", picture: donuts },
    { id: 12, name: "Macarons", picture: macarons }
];

// Export the desserts array
export default desserts;
